from pybricks.hubs import PrimeHub
from pybricks.parameters import Axis, Button, Direction, Port, Stop
from pybricks.pupdevices import ColorSensor, Motor
from pybricks.robotics import DriveBase
from pybricks.tools import StopWatch, multitask, run_task, wait

from pi_turn import _pi_turn_heading_async, p_turn_incremental_async, p_turn_incremental_sync, reset_current_heading, update_current_heading

# Set up all devices.
prime_hub = PrimeHub(top_side=Axis.Z, front_side=Axis.X)
right_light = ColorSensor(Port.A)
left_light = ColorSensor(Port.B)
timer = StopWatch()
left = Motor(Port.F, Direction.COUNTERCLOCKWISE)
right = Motor(Port.E, Direction.CLOCKWISE)
drive_base = DriveBase(left, right, 62.4, 110)
left_attachment = Motor(Port.D, Direction.CLOCKWISE)
right_attachment = Motor(Port.C, Direction.COUNTERCLOCKWISE)

# Initialize variables.
run_tracker = 1
heading_before_turn = 0
statue_heading_stop = 0
incremental_return_to_original = 0

async def display_number(number):
    await wait(0)
    prime_hub.display.off()
    if number == 1:
        prime_hub.display.pixel(0, 2, 100)
        prime_hub.display.pixel(1, 2, 100)
        prime_hub.display.pixel(2, 2, 100)
        prime_hub.display.pixel(3, 2, 100)
        prime_hub.display.pixel(4, 2, 100)
    else:
        prime_hub.display.number(number)

async def subtask():
    while not Button.RIGHT in prime_hub.buttons.pressed():
        await wait(0)
    await reset_current_heading()
    prime_hub.imu.reset_heading(0)
    await execute_run()
    await increase_tracker()
    await wait(220)

async def subtask2():
    while not Button.LEFT in prime_hub.buttons.pressed():
        await wait(0)
    await increase_tracker()
    await wait(220)

async def subtask3():
    while not Button.BLUETOOTH in prime_hub.buttons.pressed():
        await wait(0)
    await what_just_happened()

async def execute_run():
    await wait(0)
    if run_tracker == 1:
        await gardener_run()
    elif run_tracker == 2:
        await mma_run()
    elif run_tracker == 3:
        await item_dump()
    elif run_tracker == 4:
        await sandstorm_run()
    elif run_tracker == 5:
        await blue_cheese_machine()
    elif run_tracker == 6:
        await bumblebee_run()
    else:
        await speedy_santa_run()
    drive_base.stop()

async def increase_tracker():
    global run_tracker
    await wait(0)
    run_tracker = run_tracker + 1
    if run_tracker == 8:
        run_tracker = 1

async def p_turn_increment_mma(angle):
    await wait(0)
    await p_turn_incremental_async(angle, left, right, prime_hub, 0)

async def p_turn_increment_cheese(angle):
    await wait(0)
    await p_turn_incremental_async(angle, left, right, prime_hub, 5)

async def p_turn_increment_sand(angle):
    await wait(0)
    await p_turn_incremental_async(angle, left, right, prime_hub, 10)

async def p_turn_increment_custom(angle, c_val):
    await wait(0)
    await p_turn_incremental_async(angle, left, right, prime_hub, c_val)

async def p_turn_increment_garden(angle):
    await wait(0)
    await p_turn_incremental_async(angle, left, right, prime_hub, 11)

async def p_turn_increment_santa(angle):
    await wait(0)
    await p_turn_incremental_async(angle, left, right, prime_hub, 0)

async def p_turn_increment_bee(angle):
    await wait(0)
    await p_turn_incremental_async(angle, left, right, prime_hub, 6)

async def item_dump():
    await wait(0)
    drive_base.settings(straight_speed=800)
    await drive_base.straight(-450, then=Stop.COAST)
    await drive_base.straight(450, then=Stop.COAST)
    drive_base.stop()

async def gardener_run():
    await wait(0)
    prime_hub.imu.reset_heading(0)
    drive_base.settings(straight_speed=350)
    await drive_base.straight(520)
    await p_turn_increment_garden(30)
    await drive_base.straight(145)
    await p_turn_increment_garden(-75)
    await multitask(
        drive_base.straight(240),
        wait(2500),
        race=True,
    )
    await drive_base.straight(-60)
    await left_attachment.run_angle(500, -300)
    await drive_base.straight(40)
    await left_attachment.run_angle(500, 300)
    await drive_base.straight(-155)
    await p_turn_increment_garden(45)
    await drive_base.straight(-120)
    await p_turn_incremental_async(90, left, right, prime_hub, 8)
    await multitask(
        drive_base.straight(-130),
        wait(2000),
        race=True,
    )
    await multitask(
        right_attachment.run_angle(1500, 810),
        wait(4000),
        race=True,
    )
    await right_attachment.run_angle(1500, -810)
    await drive_base.straight(90)
    await p_turn_increment_garden(-60)
    drive_base.settings(straight_speed=520)
    await drive_base.straight(-520)
    drive_base.stop()

async def subtask4():
    drive_base.settings(straight_speed=800)
    await drive_base.straight(670)

async def mma_run():
    await wait(0)
    prime_hub.imu.reset_heading(0)
    drive_base.settings(straight_speed=300)
    drive_base.settings(straight_acceleration=750)
    await drive_base.straight(720)
    await p_turn_increment_mma(90)
    await drive_base.straight(365)
    await p_turn_increment_mma(-90)
    drive_base.settings(straight_speed=80)
    await drive_base.straight(-75)
    await right_attachment.run_angle(200, 250)
    await drive_base.straight(50)
    await multitask(
        right_attachment.run_angle(1000, -300),
        wait(2500),
        race=True,
    )
    await wait(100)
    drive_base.settings(straight_speed=150)
    await drive_base.straight(195)
    await left_attachment.run_angle(1000, -1200)
    await wait(100)
    await left_attachment.run_angle(1000, 1200)
    drive_base.settings(straight_speed=200)
    await drive_base.straight(-170)
    await drive_base.straight(70)
    await p_turn_increment_mma(-84)
    drive_base.settings(straight_speed=400)
    await drive_base.straight(350)
    await p_turn_increment_mma(-80)
    await left_attachment.run_angle(1000, -1000)
    await multitask(
        subtask4(),
        wait(500),
    )

async def subtask5():
    global statue_heading_stop
    await p_turn_increment_sand(26)
    statue_heading_stop = prime_hub.imu.heading()

async def subtask6():
    global statue_heading_stop
    await wait(1000)
    statue_heading_stop = prime_hub.imu.heading()

async def sandstorm_run():
    global heading_before_turn, statue_heading_stop, incremental_return_to_original
    await wait(0)
    drive_base.use_gyro(True)
    drive_base.settings(straight_speed=250)
    await multitask(
        drive_base.straight(-365),
        right_attachment.run_angle(1000, 185),
    )
    await wait(25)
    drive_base.settings(straight_speed=250)
    await drive_base.straight(160)
    await p_turn_increment_sand(-49.5)
    await drive_base.straight(-196)
    await p_turn_increment_sand(45)
    await multitask(
        drive_base.straight(-130),
        right_attachment.run_angle(1000, -100),
    )
    await left_attachment.run_angle(180, 180)
    await wait(25)
    await left_attachment.run_angle(360, -180)
    await multitask(
        drive_base.straight(100),
        right_attachment.run_angle(1000, 100),
    )
    await p_turn_increment_sand(-15)
    await drive_base.straight(-300)
    await p_turn_increment_sand(15)
    await drive_base.straight(-85, then=Stop.NONE)
    while not await right_light.reflection() < 20:
        await wait(0)
        drive_base.drive(-150, 0)
    await p_turn_increment_sand(47)
    right_attachment.reset_angle(0)
    await right_attachment.run_angle(1000, -200)
    await drive_base.straight(195)
    await multitask(
        p_turn_increment_custom(25, 17),
        left_attachment.run_angle(1000, 180),
    )
    await right_attachment.run_angle(1000, 200)
    heading_before_turn = prime_hub.imu.heading()
    await multitask(
        subtask5(),
        subtask6(),
        race=True,
    )
    incremental_return_to_original = -1 * abs(statue_heading_stop - heading_before_turn)
    await p_turn_increment_sand(incremental_return_to_original)
    await left_attachment.run_angle(1000, -180)
    await right_attachment.run_angle(1000, 275)
    await p_turn_increment_custom(85, -10)
    await drive_base.straight(240)
    await multitask(
        p_turn_increment_sand(-30),
        wait(1000),
        race=True,
    )
    await update_current_heading(prime_hub)
    await drive_base.straight(-205)
    await _pi_turn_heading_async(20, left, right, prime_hub, 5)
    drive_base.settings(straight_speed=1000)
    await drive_base.straight(-950)

async def subtask7():
    await drive_base.straight(680)
    await p_turn_increment_bee(45)

async def subtask8():
    await wait(250)
    await left_attachment.run_angle(150, 210)

async def subtask9():
    await wait(1000)
    drive_base.settings(straight_speed=400)
    await drive_base.straight(-150)
    drive_base.settings(straight_speed=100)
    left.dc(50)
    while not prime_hub.imu.heading() >= 135:
        await wait(0)
    left.hold()

async def subtask10():
    left.dc(40)
    right.dc(40)
    while not timer.time() >= 1500:
        await wait(0)
    right.hold()
    left.hold()
    await drive_base.straight(-130)

async def subtask11():
    await multitask(
        right_attachment.run_angle(500, 175),
        wait(750),
        race=True,
    )

async def bumblebee_run():
    await wait(0)
    prime_hub.imu.reset_heading(0)
    drive_base.use_gyro(True)
    drive_base.settings(straight_speed=400)
    drive_base.settings(straight_acceleration=750)
    await multitask(
        subtask7(),
        right_attachment.run_angle(500, 5000),
        race=True,
    )
    while not await left_light.reflection() < 20:
        await wait(0)
        drive_base.drive(100, 0)
    drive_base.straight(0)
    await right_attachment.run_angle(500, -150)
    await multitask(
        right_attachment.run_angle(1000, 175),
        wait(750),
        race=True,
    )
    drive_base.settings(straight_speed=50)
    await multitask(
        drive_base.straight(57),
        subtask8(),
    )
    await multitask(
        left_attachment.run_angle(150, -250),
        subtask9(),
    )
    await drive_base.straight(-100)
    await drive_base.straight(75)
    await p_turn_increment_bee(60)
    print(prime_hub.imu.heading())
    drive_base.settings(straight_speed=200)
    await drive_base.straight(-380)
    await p_turn_increment_bee(30)
    drive_base.settings(straight_speed=200)
    await drive_base.straight(-50)
    await right_attachment.run_angle(500, -150)
    await drive_base.straight(50)
    await p_turn_increment_bee(0)
    timer.reset()
    await multitask(
        subtask10(),
        subtask11(),
    )
    await p_turn_incremental_async(-20, left, right, prime_hub, 30)
    drive_base.settings(straight_acceleration=1000)
    drive_base.settings(straight_speed=1000)
    await drive_base.straight(280)
    await p_turn_incremental_async(54, left, right, prime_hub, 30)
    await drive_base.straight(670)
    drive_base.stop()

async def subtask12():
    await multitask(
        right_attachment.run_angle(500, 120),
        wait(350),
        race=True,
    )

async def subtask13():
    await drive_base.straight(200)
    await p_turn_increment_cheese(90)

